import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import './css/all.min.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Routing from './Routing';
import { Router } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
      <BrowserRouter>
        <Router>
          <Routing />
        </Router>
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
